//! This module tests the library's analysis capabilities on the
//! `CpuFrilessVerifier` contract`.
#![cfg(test)]

use storage_layout_extractor::watchdog::LazyWatchdog;

mod common;

/// Tests the library on the bytecode of the CpuFrilessVerifier contract
/// deployed [here](https://etherscan.io/address/0xc879af7d5ed80e4676c203fd300e640c297f31e3).
#[test]
fn correctly_generates_a_layout() -> anyhow::Result<()> {
    // Create the extractor
    let bytecode = "";
    let extractor = common::new_extractor_from_bytecode(bytecode, LazyWatchdog.in_rc())?;

    // Get the final storage layout for the input contract
    let layout = extractor.analyze()?;

    // While this contract does make use of storage opcodes (only SLOADs), we
    // currently saturate our limiters before ever reaching them. More sophisticated
    // execution strategies will be needed to see them here.
    //
    // To that end, the layout we output has no slots.
    assert!(layout.is_empty());

    Ok(())
}
